INSERT INTO `noticia` (`idnoticia`, `titulo`, `cuerpo`, `fecha`) VALUES
(10, 'CADETES DEL SELECCIONADO DE VELA', 'Seleccionado de Vela de la Escuela Naval, ganó la vigésima primera edición de la Regata Santander Interclubes, que se desarrolló en la Cofradía Náutica del Pacífico Algarrobo el pasado fin de semana, cerrando además la tercera fecha del Nacional Oceánico.\r\n\r\nLa jornada final de la tradicional regata, consistió en dos regatas barlovento-sotavento para Soto 40, IRC, Melges 24 y J-105, y una travesía para los cruceros, que se desarrolló con vientos de 12 nudos del suroeste y con la participación de más de 30 embarcaciones', '2015-11-26 15:58:12'),
(11, '42° VERSIÓN REGATA OFF VALPARAÍSO', 'Este fin de semana se desarrolló la Cuadragésimo Segunda versión de la Regata Off Valparaíso, la competencia náutica más tradicional de nuestro país.\r\n\r\nLa regata organizada por la Escuela Naval “Arturo Prat”, con apoyo técnico del Club Náutico Oceánico de Chile , este año tuvo un tinte emotivo. Se realizó un especial homenaje al Comandante Carlos Risso, destacado velerista nacional, quien falleció recientemente en un lamentable accidente.\r\n\r\nEsta actividad deportiva reunió a más de cuarenta barcos y más de 200 deportistas, que comenzaron su navegación el viernes16, y terminaron con una ceremonia de premiación el domingo 18 de octubre.', '2015-11-26 16:08:21');
